import React from 'react';
import {BrowserRouter, Routes, Route} from "react-router-dom";


const App = () => {
    return (
        <div>
            <BrowserRouter>
                <Routees>
                    <Route path="/" element={<Home></Home>}></Route>
                </Routees>
            </BrowserRouter>
        </div>
    );
};

export default App;
